import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
function card(props){
  return(
    <div className="cards">
      <div className="card">
        <img src={props.imgsrc} alt="mypic" className="card__img" />
        <div className="card__info">
          <span className="card__category"> My Instagram</span>
          <h3 className="card__title"></h3>
          <a href="https://www.instagram.com/mr.svm.brdwj/?hl=en" target="_shiv">
            <button>Click Now </button>
          </a>
        </div>

      </div>
    </div>
  )

}
ReactDOM.render(
  <>
    <card 
      imgsrc = "https://instagram.fccu11-1.fna.fbcdn.net/v/t51.2885-19/s320x320/81507132_122290828968995_7210668143390228480_n.jpg?_nc_ht=instagram.fccu11-1.fna.fbcdn.net&_nc_ohc=DG7_q2Ok478AX9cxG15&oh=be7c38da33be32775d8ae6a512e9b934&oe=5F33D3B7"
    />

  </>,
  document.getElementById('root')
);
